// TRI_STATE Configuration Register
// Below set of registers are used to control the PAD Behaviour.
// These TRISTATE registers need to be programmed before to tristate the pads which are
// not used for Power consumptions.
// Z_<PIN_GROUP> indicated the enable for TRISTATING the pads in the
// respective // <PIN_GROUP>
// Enum TRISTATE indicates Outputs are Tristate and NORMAL indicates they are Not
// Tristated.
// TRI STATES THE Output Pads when the Tristate Bit is enabled. This is used by SW for Power Consumption.

