// Reserved address 104 [0x68] 

// Reserved address 108 [0x6c] 
// USB PHY VBUS SENSORS control register
// This register controls the OTG VBUS sensors in the USB PHY.
// We have the following 4 VBUS sensors: 
// 1. A_VBUS_VLD
// 2. A_SESS_VLD
// 3. B_SESS_VLD
// 4. B_SESS_END
//
// The debounced status of each sensor can be read from <VBUS_SENSOR>_STS. The field
// <VBUS_SENSOR>_CHG_DET is set to 1 whenever a change is detected in the value of
// <VBUS_SENSOR>. If <VBUS_SENSOR>_INT_EN is set, then an interrupt is generated to the
// processor. This interrupt can be routed to CPU/COP by appropriately writing the USBD
// bits in the interrupt controller registers.
//
// In case Software wants to override the value for a <VBUS_SENSOR>, it can set
// <VBUS_SENSOR>_SW_EN to 1, and set <VBUS_SENSOR>_SW_VALUE to 1 or 0 as per the
// requirement.
//
// We have two debouncers for each sensor - DEBOUNCE_A and DEBOUNCE_B. The debounce values
// for them are controlled by the register UTMIP_DEBOUNCE_CFG0, fields UTMIP_BIAS_DEBOUNCE_A 
// and UTMIP_BIAS_DEBOUNCE_B. For each sensor, we can select whether to use DEBOUNCE_A or
// DEBOUNCE_B by setting the field <VBUS_SENSOR>_DEB_SEL_B to approrpriate value (SEL_A or
// SEL_B).
//
// NOTE1: Do not set either UTMIP_BIAS_DEBOUNCE_A or UTMIP_BIAS_DEBOUNCE_B to 0x0. If not
// using one of the debouncers, keep it at the default value of 0xFFFF.
//
// NOTE2: The source for A_SESS_VLD sensor can be programmed according to the setting of
// VS_CTL in register USB_PHY_PARAM.

// Register APB_MISC_PP_USB_PHY_VBUS_SENSORS_0  
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0                      _MK_ADDR_CONST(0x70)
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_SECURE                       0x0
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_WORD_COUNT                   0x1
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_RESET_VAL                    _MK_MASK_CONST(0x0)
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_RESET_MASK                   _MK_MASK_CONST(0x3f3f3f3f)
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_SW_DEFAULT_VAL                       _MK_MASK_CONST(0x0)
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_SW_DEFAULT_MASK                      _MK_MASK_CONST(0x0)
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_READ_MASK                    _MK_MASK_CONST(0x3f3f3f3f)
#define APB_MISC_PP_USB_PHY_VBUS_SENSORS_0_WRITE_MASK                   _MK_MASK_CONST(0x39393939)
