// PIN Multiplex Control Register D
// Below Pin Mux registers are used to select the Digital Interface. This register needs to be
// programmed during the initial stages to slect the interface on the pin group.
// As per AP20 PinOutSpec each pin group support upto 4 options. 
// Below specified in enum represent enum ( PRIMARY , ALT-1 , ATL-2 , ALT-3) for each pin
// group in that order. 
