// PIN Multiplex Control Register H
// This register is used for DAP-DAC selections. 
// The Digital Audio Switch (DAS) is a generic matrix which connects the three digital audio-controllers (DAC's) 
// to the four Audio-ports (DAP's) of the chip. DAS uses three sets of configuration-inputs for this purpose: 
// (1) DAP selects
// (2) DAC input-selects 
// (3) DAP Bypass-mode Master-selects. 
// Programmable connectivity for the DAC's to any of the four available DAP's is a very useful feature.  
// Any compatible codec connected on any one of the ports could be communicated to, by any of the three audio 
// controllers inside the chip, without any change in the associated hardware. Also, bypass mode allows any of
// the DAPs to be connected to any other DAP either in master-mode or in slave-mode.
// The bits from 0 to 11 are used for DAP selctions which say which DAP is connected to which DAC
// The bits from 12 to 17 say which DAP drives which DAC
// In by-pass mode, two( or more) DAPs will be in loop back. In this scenario, one of the DAPs should act as master.
// DAP?M_SEL is used for this master slections. 
//
// Few examples:
//      
//      1. DAC-DAP connectivity (Normal mode) 
//      a) Program the DAP?_CNTRL_MUX_SELECT bit-fields as desired. Only the options 000, 001, 010 signify normal mode
//      b) Program DAC?_SEL to suitable select the source for the inputs to DAC. Select based on the DAP?_CNTRL_MUX_SELECT above
//      c) For any DAC-DAP configuration, the corresponding DAP?M_SEL has no significance. Master-Slave configuration will be
//         controlled by the DAC and FW.
//
//  2. DAP-DAP connectivity (Bypass mode):
//      
//      a) Program the DAP?_CNTRL_MUX_SELECT bit-fields as desired. Only the options 100, 101, 110 and 111 signify Bypass mode
//      b) Select DAP?M_SEL to define the Master-Slave relationship
//
//
//  3. Use case (DAC1 to DAP1 and DAP2-DAP1 bypass):
//     This is a use-case where the DAP2 is in by-pass connection with DAP1 and DAP1 is connected to DAC1.
//     DAP1 is in Master mode and transmits to both DAC1 and DAP2. DAP1 receives data from only DAC1.
//     DAP3 and DAP4 are connected to DAC2 (Master). DAP2 inputs are sourced only from DAP4. 
//
//     Following is the configuration is to be used:
//      a) DAP1_CNTRL_MUX_SELECT  = 000 (DAP1-DAC-1)
//      b) DAP2_CNTRL_MUX_SELECT  = 100 (Bypass to DAP1)
//      c) DAP1M_SEL = 1 (DAP1 in Master: this is required as DAP2 is in Bypass mode)
//      d) DAP2M_SEL = 0 (DAP2 in Slave: this is required as DAP2 is in Bypass mode)
//      e) DAC1_SEL = 00 (DAC1 will receive data from the Master DAP1)
//      f) DAP3_CNTRL_MUX_SELECT  = 001 (DAP3-DAC2)
//      g) DAP4_CNTRL_MUX_SELECT  = 001 (DAP4-DAC2)
//      h) DAP3M_SEL = 0 (Can leave at its default value: not of any significance here)
//      i) DAP4M_SEL = 0 (Can leave at its default value: not of any significance here)
//      j) DAC2_SEL = 11 (DAC2 inputs sourced from DAP4- DAC2 can transmit to DAP3 and DAP4
//                        but can receive from DAP4 only)
// Pin Mux Selection register, Based on the Select signals Particular interface is 
// selected, Please refer the Pin Spec for Muxing Options.

