// PULL_UP/PULL_DOWN Control Register
// Controls the pull_up/pull_down inputs of the pads. Used to eliminating external components on interfaces that need pullup/pulldown.
// more explanation for pad control - pullup, pull down
// Those are weak internal pullup/pulldowns 
// NORMAL setting means pad is neither pulled up (driving weak 1) or pulled down (driving weak 0)
// PULL_DOWN selection means pad is driving weak 0
// PULL_UP selection means pad is driving weak 1
// WARNING!! driving internal pullup when pad has external pull down and vice versa will cause signifcant increase in power consumption
//
// cross reference of fields with real ball names
//   field name         controls balls
//-------------------------------
//   PMCB_PU_PD         SYS_CLK_REQ
//   PMCA_PU_PD         LED_BLINK
//   KBCE_PU_PD         KB_ROW3
//   KBCF_PU_PD         KB_COL3,KB_COL4,KB_COL5,KB_COL6

