// SUPERCEDED by NV_pmc IOPWR control bits, remove these controls but preserve addressing

// Reserved address 1028 [0x404] 
// IO Power Configuration.  Since power is controlled externally, software must set this
// register to tell the chip which IO have power (setting IOPWR_DIS to DISABLE).  HOST is
// always on.
//reg     IOPWRCONFIG  incr4
//        0       rw  EM_IOPWR_DIS  i=0x1    // External Memory IO power disable
//            enum ( DISABLE, ENABLE )
//        1       rw  AUDIO_IOPWR_DIS i=0x1  // AUDIO IO power disable
//            enum ( DISABLE, ENABLE )
//        2       rw  SD_IOPWR_DIS  i=0x1    // SD IO power disable
//            enum ( DISABLE, ENABLE )
//        3       rw  VI_IOPWR_DIS  i=0x1    // Camera interface IO power disable
//            enum ( DISABLE, ENABLE )
//        4       rw  LCD_IOPWR_DIS i=0x1    // LCD interface IO power disable
//            enum ( DISABLE, ENABLE )
//        5       rw  TVDAC_IOPWR_DIS i=0x1  // TVDAC interface IO power disable
//            enum ( DISABLE, ENABLE )
//        6       rw  CSI_IOPWR_DIS i=0x1    // CSI interface IO power disable
//            enum ( DISABLE, ENABLE )
//
//;

