// DAC_COMP_TH[1:0] is to choose threshold voltage of the internal comparator for load detection.
//   {0, 1, 2, 3} for {0.24 V, 0.30 V, 0.48 V, 0.60 V}
// DAC_BGAP_AVG_ON is to enable bandgap averaging (default is 0).
