// TV DAC FIFO config
// DAC_FIFO_TH[2:0] is to specify number of pixels kept in the input FIFO.
// DAC_SOURCE[1:0] is to specify input signal sources to the TVDAC.
//   The sources are TVO, DISPLAY, and DISPLAYB.
// DAC_DIN_ORIDE_EN is to enable DAC_DIN_ORIDE to override the input signal.
// DAC_DIN_ORIDE[9:0] is to override regular input signals for testing.
// DAC_AMPIN[7:0] is to set DAC output amplitude.
//   There are 3 ways that DAC's output amplitude range is calibrated.
//   They are,
//      1. SDTV mode (VREF=1.4V)
//      2. CRT (VGA) mode (VREF=0.7V)
//      3. HDTV mode (VREF=1.0V)
//   Corresponding calibration values for DAC_AMPIN are provided from FUSE module.
//   They are,
//      1. DAC_SDTV_CALIB[7:0]
//      2. DAC_CRT_CALIB[7:0]
//      3. DAC_HDTV_CALIB[7:0]
//   Corresponding to the DAC_SOURCE selection, those calibration values shall be selectively 
//     loaded to DAC_AMPIN.
//   DAC_SOURCE          DAC_AMPIN
//     0  (TVDAC_OFF)    (dont_care)
//     1  (TVO)          DAC_SDTV_CALIB[7:0] 
//     2  (DISPLAY)      DAC_CRT_CALIB[7:0]
//     3  (DISPLAYB)     DAC_CRT_CALIB[7:0]
//

