///////////////////////////////////////////////////////////////////////////////////////////////////////////
// registers bellow control pad behaviour. PULL_UP and PULL_DOWN are serviced by arapb_misc_pp registers //
///////////////////////////////////////////////////////////////////////////////////////////////////////////
//
// for each digital pad following controls can be used to tune pad performance, power consumption
//
// HSM_EN - high speed mode - active high, enables high speed mode for driver and receiver
// for better matching of the rise/fall delay  in outbound and inbound paths. Use it for clocks and the high speed signaling where the matching timings are of importance.
//
// SCHMT_EN -  schmt enable - active high, enables the Schmitt Trigger Type of I/P receiver.  Default is Inverter Type of receiver.
//
// LPMD - low power mode - select low power modes (different impedance and current value). The table depicts the function of low power mode
//
// LPMD1    LPMD0       Power Mode Selected
//
//  0       0       X/8 Current Setting. Lowest Power or Current ( 8*Z ohm)
//  0       1       X/4 Current Setting ( 4*Z ohm)
//  1       0       X/2 Current Setting ( 2*Z ohm)
//  1       1       X current Setting ( Z ohm = 50ohm )Highest Power or Current.
//  
// CAL_DRVDN - drive down (falling edge) - Driver Output Pull-Down drive strength code. 
// CAL_DRVUP - drive up (rising edge)  - Driver Output Pull-Up drive strength code. 
// works with combination of LMPD bits. for lower power modes, higher drive strenght are masked. see table bellow
//
//
//  LPMD1       LPMD0   CAL_DRV*4       CAL_DRV*3       CAL_DRV*2       CAL_DRV*1       CAL_DRV*0
//  0           0       Masked to 0     Masked to 0     Masked to 0     Pass Code       Pass Code
//  0           1       Masked to 0     Masked to 0     Pass Code       Pass Code       Pass Code
//  1           0       Masked to 0     Pass Code       Pass Code       Pass Code       Pass Code
//  1           1       Pass Code       Pass Code       Pass Code       Pass Code       Pass Code
//
//  DRVDN_SLWR - Driver Output Pull-Up slew control code  - 2bit code
//  code 11 is least slewing of signal. code 00 is highest slewing of the signal.
//
//  DRVUP_SLWF -Driver Output Pull-Down slew control code - 
//  code 11 is least slewing of signal. code 00 is highest slewing of the signal. 
//
///////////////////////////////////////////////////////////////////////////////////////////////////////////
//   end of general pad description functionality                                                        //
///////////////////////////////////////////////////////////////////////////////////////////////////////////
