// PLL CONFIGURATION & PARAMETERS
// In normal operation, the following clock generators are in play for USB:
// Xtal clock -> enters PLL_U to generate 12MHz clock -> enters USB_PHY PLL to generate 480/60 MHz clock
//
// The following parameters control the bringup of the plls: 
// Coming out of reset or suspend
// -> PllUOnState: start pllu_enable_count and pll_lock_count
//    -> Wait ~1us to actually enable the PLL_U (pllu_enable_count == ClkXtal * PLLU_ENABLE_DLY_COUNT * 8)
//    -> Wait ~1ms until PLL_U is actually stable (pll_lock_count == ClkXtal * PLLU_STABLE_COUNT * 256) => USB_PHY PLL_ENABLE
//       pll_active_count = 0
//       -> Wait 5us to enable pll_active: pll_active_count == ClkXtal * PLL_ACTIVE_DLY_COUNT * 16 => USB_PHY PLL_ACTIVE
//    -> Wait ~2.5ms until USB_PHY is actually stable (pll_lock_count == ClkXtal * XTAL_FREQ_COUNT * 256)   => USB_PHY 
//    
// Numbers for a 19.2MHz Xtal clock
// PLLU_ENABLE_DLY_COUNT[4:0] = 1 * 19.2 / 8 = 2.4 =   3 = 0x03
// PLLU_STABLE_COUNT[11:0]    = 1000 * 19.2 / 256  =  75 = 0x4b (Note: currently defaults to 0x600. BAD!)
// PLL_ACTIVE_DLY_COUNT[4:0]  = 5 * 19.2 / 16      =   6 = 0x06
// XTAL_FREQ_COUNT[11:0]      = 2500 * 19.2 / 256  = 187 = 0xbb        

