//
// These registers are used for DAP-DAC selections. 
// The Digital Audio Switch (DAS) is a generic matrix which connects the three digital audio-controllers (DAC's) 
// to the five Audio-ports (DAP's) of the chip. DAS uses seven sets of configuration bits for this purpose: 
// (1) DAP selects
// (2) DAP Bypass-mode Master-selects. 
// (3) DAP DATA1 direction selects(either tx or rx). 
// (4) DAP DATA2 direction selects(either tx or rx). 
// (5) DAC CLOCK input-selects 
// (6) DAC DATA1 input-selects 
// (7) DAC DATA2 input-selects 
//
// Any compatible codec connected on any one of the ports could be communicated to, by any of the three audio 
// controllers inside the chip, without any change in the associated hardware. 
// Also, bypass mode allows any of the DAPs to be connected to any other DAP either in master-mode or in slave-mode.
// In by-pass mode, two( or more) DAPs will be in loop back. In this scenario, one of the DAPs should act as master.
// DAP_MS_SEL is used for this master slections. 
//
// Few examples:
//      
//      1. DAC-DAP connectivity (Normal mode) 
//      a) Program the DAP_CTRL_SEL bit-fields as desired. Only the options 00000, 00001, 00010 and 00011 signify normal mode
//      b) Program DAC_INPUT_DATA_CLK_SEL register to select the source for the inputs to DAC. Select based on the DAP_CTRL_SEL_? above
//      c) For any DAC-DAP configuration, the corresponding DAP_MS_SEL has no significance. 
//
//  2. DAP-DAP connectivity (Bypass mode):
//      
//      a) Program the DAP_CTRL_SEL bit-fields as desired. Only the options 01000, 01001, 01010, 01011 and 01100  signify Bypass mode
//      b) Select DAP_MS_SEL to define the Master-Slave relationship
//
//
//  3. Use case (DAC1 to DAP1 and DAP2-DAP1 bypass):
//     This is a use-case where the DAP2 is in by-pass connection with DAP1 and DAP1 is connected to DAC1.
//     DAP1 is in Master mode and transmits to both DAC1 and DAP2. DAP1 receives data from only DAC1.
//     DAP3 and DAP4 are connected to DAC2 (Master). DAP2 inputs are sourced only from DAP1.
//     DAC1 can be taken inputs from any of five DAPs.
//DAP control register. 

